import pprint
import string


buffer = ""

def has_repeated_chars(string):
    for char in string:
        if string.count(char) > 1:
            return True

def sub_routine(buffer):
    markerFound = False
    check = ""
    start = 0
    end = 14
    while not markerFound:
        check = buffer[start:end]
        if(has_repeated_chars(check)):
            start+=1
            end+=1
        else:
            markerFound = True
    return end

def main():
    pprint.pprint(sub_routine(buffer))

if __name__ == "__main__":
    main()
